import React from 'react';
import './HomePage.css';

const HomePage = () => {
  return (
    <div className="homepage">
      <h1>Welcome to the Feed Comparison Tool</h1>
      <p>This tool allows you to compare various social media feed data based on different metrics.</p>
      <button>Start Comparison</button>
    </div>
  );
}

export default HomePage;
